  return (
    <SideBarcss>
      <div className="sidebtn">
        <FaMoneyCheck className="icon" />
        <span className="btn-name">Spending</span>
      </div>

      <div className="sidebtn">
        <FaMoneyCheck className="icon" />
        <span className="btn-name">Transactions</span>
      </div>
    </SideBarcss>
  );
}

export default SideBar;
